ion$lat_round), ]\n","\n","# Create a ggplot object for the USA map with location-wise scores\n","usa_basemap <- ggplot() +\n","  borders(\"usa\", colour = \"yellow\", fill = \"yellow\") +  \n","  borders(\"state\", colour = \"grey\", size = 0.2, fill = NA) +  \n","  theme_map()\n","\n","## Plotting the scores\n","McSentimentMap <- usa_basemap + \n","  geom_point(data = McSentimentLocation,\n","             aes(long_round, lat_round, size = score, color = factor(score >= 0)),\n","             alpha = 0.5) +\n","  scale_size_continuous(range = c(1, 10),\n","                        breaks = c(-600, -400, -200, 0, 200, 400, 600),\n","                        labels = c(\"-600\", \"-400\", \"-200\", \"0\", \"200\", \"400\", \"600\"),\n","                        name = \"Sentiment Score\") +\n","  scale_color_manual(values = c(\"red\", \"green\"),\n","                     labels = c(\"Negative\", \"Positive\"),\n","                     name = \"Sentiment\") +\n","  coord_fixed() +\n","  labs(title = \"Sentiment Score in McDonald's Locations of USA\",\n","       size = \"Sentiment Score\")\n","\n","print(McSentimentMap)"]},{"cell_type":"markdown","id":"1a24d046","metadata":{"papermill":{"duration":0.0288,"end_time":"2024-01-01T15:17:31.25909","exception":false,"start_time":"2024-01-01T15:17:31.23029","status":"completed"},"tags":[]},"source":["# Conclusion\n","* The customers are actively speaking on the McDonald's experience as per the word cloud.\n","* Customers seems to talk about Fries more when it comes to food items.\n","* The overall sentiment analysis provides a slightly positive sentiment score of 0.058.\n","* Client reviews for store 10 (1415 E State Rd, Fern Park) shows the highest positive sentiment score.\n","* Comparatively, store 14 (1650 Washington Ave, Miami Beach) shows the higest negative sentiment score.\n","* 28/40 stores are showing positive sentiment scores, which indicates good client satisfaction, while indicating room for possible improvements for those with negative scores.\n","* It is interesting to note that the lowest negative sentiment score reported is way lower than the highest positive sentiment score reported on the scale in store wise sentiment scores.\n","* It can be more accurate to optimise the analysis with mean value per reviews for each location, for the sentiment scores.\n","* Similar kind of analysis into reviews of each locations (wordclouds, positive/negative words) might reveal the issues with each locations to improve them.\n","* Additionally further analysis can be conducted to investigate the context and word associations for positive/negative words to come up with further improvement points for each store."]},{"cell_type":"markdown","id":"961c037a","metadata":{"papermill":{"duration":0.028858,"end_time":"2024-01-01T15:17:31.31621","exception":false,"start_time":"2024-01-01T15:17:31.287352","status":"completed"},"tags":[]},"source":["# References\n","\n","Dataset:\n","Elgiriyewithana, N. (2023) ‘McDonald’s Store Reviews’. "]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":3422393,"sourceId":5968827,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":23.876743,"end_time":"2024-01-01T15:17:31.468256","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-01-01T15:17:07.591513","version":"2.5.0"}},"nbformat":4,"nbformat_minor":5}